/**
 * Rejestracja nowego użytkownika.
 *
 * @swagger
 * /api/user/register:
 *   post:
 *     summary: Rejestracja nowego użytkownika
 *     description: Endpoint służący do rejestracji nowego użytkownika.
 *     tags:
 *       - Users
 *     requestBody:
 *       required: true
 *       content:
 *         application/json:
 *           schema:
 *             type: object
 *             properties:
 *               firstName:
 *                 type: string
 *                 description: Imię nowego użytkownika.
 *                 example: Kacper
 *               lastName:
 *                 type: string
 *                 description: Nazwisko nowego użytkownika.
 *                 example: Słabik
 *               email:
 *                 type: string
 *                 format: email
 *                 description: Adres email nowego użytkownika.
 *                 example: kacpero1407@gmail.com
 *               password:
 *                 type: string
 *                 format: password
 *                 description: Hasło nowego użytkownika.
 *                 example: $2a$10$ZyT2FRTmtQijdKAV2A11r.11MbEx2EqRvV/LIlLgBU09gsPGsc5AO
 *               profileImage:
 *                 type: string
 *                 description: Zdjęcie profilowe nowego użytkownika (opcjonalne).
 *                 example: "data:image/jpeg;base64,"
 *             required:
 *               - firstName
 *               - lastName
 *               - email
 *               - password
 *     responses:
 *       200:
 *         description: Sukces. Link autoryzacyjny został wysłany na podany adres email.
 *         content:
 *           application/json:
 *             schema:
 *               type: object
 *               properties:
 *                 message:
 *                   type: string
 *                   description: Komunikat informujący o pomyślnym wysłaniu linku autoryzacyjnego.
 *                 success:
 *                   type: boolean
 *                   description: Wartość logiczna określająca sukces operacji.
 *       409:
 *         description: Konflikt. Użytkownik o podanym adresie email już istnieje.
 *         content:
 *           application/json:
 *             schema:
 *               type: object
 *               properties:
 *                 message:
 *                   type: string
 *                   description: Komunikat informujący o istnieniu użytkownika o podanym adresie email.
 *                 success:
 *                   type: boolean
 *                   example: false
 *                   description: Wartość logiczna określająca sukces operacji.
 *       500:
 *         description: Wystąpił błąd serwera.
 *         content:
 *           application/json:
 *             schema:
 *               type: object
 *               properties:
 *                 message:
 *                   type: string
 *                   description: Komunikat informujący o błędzie serwera.
 *                 success:
 *                   type: boolean
 *                   example: false
 *                   description: Wartość logiczna określająca sukces operacji.
 */

router.post('/register', async (req, res) => {
	try {
		const userExists = await User.findOne({ email: req.body.email });
		if (userExists) {
			return res
				.status(409)
				.send({ message: 'Użytkownik już istnieje!', success: false });
		}

		const hashedPassword = await bcrypt.hash(req.body.password, 10);

		const newuser = new User({
			firstName: req.body.firstName,
			lastName: req.body.lastName,
			email: req.body.email,
			password: hashedPassword,
			profileImage: req.body?.profileImage,
		});

		await newuser.save();

		const token = jwt.sign({ userId: newuser._id }, process.env.JWT_SECRET, {
			expiresIn: '1d',
		});

		const verificationLink = `http://localhost:3000/verify-email/${token}`;

		const mailOptions = {
			from: 'your.mail@gmail.com',
			to: req.body.email,
			subject: 'Potwierdzenie rejestracji',
			html: `<p>Kliknij <a href="${verificationLink}">tutaj</a> aby potwierdzić rejestrację.</p>`,
		};

		transporter.sendMail(mailOptions, (error, info) => {
			if (error) {
				console.error(error);
				res.status(500).send({
					message: 'Błąd wysyłania linku autoryzacyjnego!',
					success: false,
				});
			} else {
				res.status(200).send({
					message:
						'Link autoryzacyjny został wysłany na podany mail. Na potwierdzenie masz 24h.',
					success: true,
				});
			}
		});
	} catch (error) {
		console.error(error);
		res.status(500).send({
			message: 'Błąd rejestracji.',
			success: false,
			error: error.message,
		});
	}
});

/**
 * Weryfikacja adresu e-mail użytkownika.
 *
 * @swagger
 * /api/user/verify-email/{token}:
 *   get:
 *     summary: Weryfikacja adresu e-mail użytkownika
 *     description: |
 *       Endpoint służący do weryfikacji adresu e-mail użytkownika na podstawie przesłanego tokena w linku aktywacyjnym.
 *     tags:
 *       - Users
 *     parameters:
 *       - in: path
 *         name: token
 *         description: Token weryfikacyjny przesłany w linku aktywacyjnym
 *         required: true
 *         schema:
 *           type: string
 *     responses:
 *       '200':
 *         description: E-mail został pomyślnie zweryfikowany
 *         content:
 *           application/json:
 *             schema:
 *               type: object
 *               properties:
 *                 message:
 *                   type: string
 *                   description: Potwierdzenie, że e-mail został zweryfikowany pomyślnie
 *                 success:
 *                   type: boolean
 *                   description: Wartość logiczna określająca sukces operacji
 *                   example: true
 *       '400':
 *         description: Brak tokenu weryfikacyjnego
 *         content:
 *           application/json:
 *             schema:
 *               type: object
 *               properties:
 *                 message:
 *                   type: string
 *                   description: Komunikat informujący o braku tokenu weryfikacyjnego
 *                 success:
 *                   type: boolean
 *                   description: Wartość logiczna określająca sukces operacji
 *                   example: false
 *       '404':
 *         description: Nie znaleziono użytkownika
 *         content:
 *           application/json:
 *             schema:
 *               type: object
 *               properties:
 *                 message:
 *                   type: string
 *                   description: Komunikat informujący o braku użytkownika o podanym identyfikatorze
 *                 success:
 *                   type: boolean
 *                   description: Wartość logiczna określająca sukces operacji
 *                   example: false
 *       '500':
 *         description: Wystąpił błąd serwera
 *         content:
 *           application/json:
 *             schema:
 *               type: object
 *               properties:
 *                 message:
 *                   type: string
 *                   description: Komunikat informujący o wystąpieniu błędu serwera
 *                 success:
 *                   type: boolean
 *                   description: Wartość logiczna określająca sukces operacji
 *                   example: false
 */

router.get('/verify-email/:token', async (req, res) => {
	const token = req.params.token;
	if (!token) {
		return res.status(400).send({ message: 'Brak tokenu weryfikacyjnego!' });
	}

	try {
		const decodedToken = jwt.verify(token, process.env.JWT_SECRET);

		const userId = decodedToken.userId;

		const user = await User.findById(userId);

		if (!user) {
			return res.status(404).send({ message: 'Nie znaleziono uzytkownika!' });
		}

		user.verified = true;
		await user.save();

		res.status(200).send({ message: 'E-mail zweryfikowany pomyślnie!' });
	} catch (error) {
		console.error(error);
		res.status(500).send({
			message: 'Link aktywacyjny wygasł! Spróbuj zarejestrować się ponownie.',
			error,
		});
	}
});

/**
 * Logowanie użytkownika.
 *
 * @swagger
 * /api/user/login:
 *   post:
 *     summary: Logowanie użytkownika
 *     description:
 *       Endpoint służący do logowania użytkownika.
 *     tags:
 *       - Users
 *     requestBody:
 *       required: true
 *       content:
 *         application/json:
 *           schema:
 *             type: object
 *             properties:
 *               email:
 *                 type: string
 *                 format: email
 *                 description: Adres email użytkownika.
 *                 example: kacpero1407@gmail.com
 *               password:
 *                 type: string
 *                 format: password
 *                 description: Hasło użytkownika.
 *                 example: $2a$10$ZyT2FRTmtQijdKAV2A11r.11MbEx2EqRvV/LIlLgBU09gsPGsc5AO
 *     responses:
 *       '200':
 *         description: Sukces. Użytkownik został pomyślnie zalogowany.
 *         content:
 *           application/json:
 *             schema:
 *               type: object
 *               properties:
 *                 message:
 *                   type: string
 *                   description: Komunikat informujący o pomyślnym zalogowaniu.
 *                 success:
 *                   type: boolean
 *                   description: Wartość logiczna określająca sukces operacji.
 *                   example: true
 *                 data:
 *                   type: string
 *                   description: Token uwierzytelniający użytkownika.
 *                 isAdmin:
 *                   type: boolean
 *                   description: Wartość logiczna określająca czy użytkownik jest administratorem.
 *                 redirect:
 *                   type: string
 *                   description: Ścieżka przekierowania po zalogowaniu, jeśli użytkownik jest administratorem.
 *       '500':
 *         description: Wystąpił błąd serwera.
 *         content:
 *           application/json:
 *             schema:
 *               type: object
 *               properties:
 *                 message:
 *                   type: string
 *                   description: Komunikat informujący o błędzie serwera podczas logowania.
 *                 success:
 *                   type: boolean
 *                   description: Wartość logiczna określająca sukces operacji.
 *                   example: false
 */

router.post('/login', async (req, res) => {
	try {
		const user = await User.findOne({ email: req.body.email });

		if (!user) {
			return res.status(200).send({
				message:
					'Użytkownik nie istnieje! Aby zalogować się najpierw zarejestruj się.',
				success: false,
			});
		}

		if (user.isBlocked) {
			return res.status(200).send({
				message:
					'Użytkownik został zablokowany! Skontaktuj się z administracją.',
				success: false,
			});
		}

		const isMatch = await bcrypt.compare(req.body.password, user.password);

		if (!isMatch) {
			return res
				.status(200)
				.send({ message: 'Nieprawidłowe hasło!', success: false });
		} else {
			const token = jwt.sign({ id: user._id }, process.env.JWT_SECRET, {
				expiresIn: '1h',
			});

			const currentDate = new Date();

			const userLoggedIn = user.activeSessions.some(
				(session) => session.token !== ''
			);

			if (userLoggedIn) {
				return res.status(200).send({
					message: 'Użytkownik jest już zalogowany! Spróbuj ponownie później.',
					success: false,
				});
			}

			let userUpdateResult = await User.findOneAndUpdate(
				{ _id: user._id, 'activeSessions.token': '' },
				{
					$set: {
						'activeSessions.$.token': token,
						'activeSessions.$.lastModified': currentDate,
					},
				}
			);

			if (!userUpdateResult) {
				userUpdateResult = await User.findOneAndUpdate(
					{ _id: user._id },
					{ $push: { activeSessions: { token, lastModified: currentDate } } },
					{ upsert: true }
				);
			}

			let redirect = '';
			if (user.isAdmin) {
				redirect = '/app/admin/home';
			}
			res.status(200).send({
				message: 'Zalogowano pomyślnie.',
				success: true,
				data: token,
				isAdmin: user.isAdmin,
				redirect,
			});
		}
	} catch (error) {
		console.log(error);
		res.status(500).send({ message: 'Błąd logowania!', success: false, error });
	}
});

