/**
 * Wylogowanie użytkownika.
 *
 * @swagger
 * /api/user/logout:
 *   post:
 *     summary: Wylogowanie użytkownika
 *     description: Endpoint służący do wylogowania użytkownika.
 *     tags:
 *       - Users
 *     security:
 *       - bearerAuth: []
 *     requestBody:
 *       required: true
 *       content:
 *         application/json:
 *           schema:
 *             type: object
 *             properties:
 *               userId:
 *                 type: string
 *                 description: Id użytkownika.
 *                 example: 65157f54cc938694a1c5e1a6
 *               token:
 *                 type: string
 *                 description: Token uwierzytelniający użytkownika.
 *                 example: eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjY1MTU3ZjU0Y2M5Mzg2OTRhMWM1ZTFhNiIsImlhdCI6MTcwODQ2Mzg4MSwiZXhwIjoxNzA4NDY3NDgxfQ.YtJooOOI1l3qbo9-_4II3Pu3yHxgcgBmaL-R-aLiw4o
 *             required:
 *               - userId
 *               - token
 *     responses:
 *       '200':
 *         description: Sukces. Użytkownik został pomyślnie wylogowany.
 *         content:
 *           application/json:
 *             schema:
 *               type: object
 *               properties:
 *                 success:
 *                   type: boolean
 *                   description: Wartość logiczna określająca sukces operacji.
 *                   example: true
 *                 message:
 *                   type: string
 *                   description: Komunikat informujący o pomyślnym wylogowaniu.
 *       '400':
 *         description: Błąd. Brak parametru userId lub token.
 *         content:
 *           application/json:
 *             schema:
 *               type: object
 *               properties:
 *                 success:
 *                   type: boolean
 *                   description: Wartość logiczna określająca sukces operacji.
 *                   example: false
 *                 message:
 *                   type: string
 *                   description: Komunikat informujący o braku parametru userId lub token.
 *       '404':
 *         description: Błąd. Użytkownik nie istnieje lub token nie został znaleziony.
 *         content:
 *           application/json:
 *             schema:
 *               type: object
 *               properties:
 *                 success:
 *                   type: boolean
 *                   description: Wartość logiczna określająca sukces operacji.
 *                   example: false
 *                 message:
 *                   type: string
 *                   description: Komunikat informujący o nieistniejącym użytkowniku lub nieznalezionym tokenie.
 *       '500':
 *         description: Wystąpił błąd serwera.
 *         content:
 *           application/json:
 *             schema:
 *               type: object
 *               properties:
 *                 success:
 *                   type: boolean
 *                   description: Wartość logiczna określająca sukces operacji.
 *                   example: false
 *                 message:
 *                   type: string
 *                   description: Komunikat informujący o błędzie serwera podczas wylogowywania.
 */

router.post('/logout', authMiddleware, async (req, res) => {
	try {
		const { userId, token } = req.body;

		if (!userId || !token) {
			return res
				.status(400)
				.json({ success: false, message: 'Brak parametru userId lub token.' });
		}

		const currentDate = new Date();

		const updatedUser = await User.findOneAndUpdate(
			{ _id: userId, 'activeSessions.token': token },
			{
				$set: {
					'activeSessions.$[elem].token': '',
					'activeSessions.$[elem].lastModified': currentDate,
				},
			},
			{
				new: true,
				arrayFilters: [{ 'elem.token': token }],
			}
		);

		if (!updatedUser) {
			return res.status(404).json({
				success: false,
				message: 'Użytkownik nie istnieje lub token nie został znaleziony!',
			});
		}

		res.status(200).json({ success: true, message: 'Pomyślnie wylogowano.' });
	} catch (error) {
		console.error('Błąd podczas wylogowywania:', error);
		res.status(500).json({
			success: false,
			message: 'Wystąpił błąd podczas wylogowywania.',
			error,
		});
	}
});

