router.post('/refresh-access-token', authMiddleware, async (req, res) => {
	const token =
		req.headers.authorization && req.headers.authorization.split(' ')[1];

	if (!token) {
		return res
			.status(401)
			.json({ message: 'Token dostępu jest wymagany!', success: false });
	}

	try {
		const decoded = jwt.verify(token, process.env.JWT_SECRET);
		const currentDate = new Date();

		const newAccessToken = jwt.sign(
			{ id: decoded.id },
			process.env.JWT_SECRET,
			{
				expiresIn: '1h',
			}
		);

		const updatedUser = await User.findOneAndUpdate(
			{ _id: decoded.id, 'activeSessions.token': token },
			{
				$set: {
					'activeSessions.$[elem].token': newAccessToken,
					'activeSessions.$[elem].lastModified': currentDate,
				},
			},
			{
				new: true,
				arrayFilters: [{ 'elem.token': token }],
			}
		);

		if (!updatedUser) {
			return res.status(404).json({
				success: false,
				message: 'Użytkownik nie istnieje lub token nie został znaleziony!',
			});
		}

		res.json({
			accessToken: newAccessToken,
			message: 'Pomyślnie przedłuzono aktualną sesję.',
			success: true,
		});
	} catch (error) {
		console.error('Błąd podczas odświeżania tokena:', error);
		res.status(401).json({ message: 'Nieprawidłowy token dostępu!' });
	}
});

const sendResetPasswordEmail = (email, token) => {
	const mailOptions = {
		from: 'your-email@example.com',
		to: email,
		subject: 'Resetowanie hasła',
		html: `<p>Kliknij poniższy link, aby zresetować hasło:</p><a href="http://localhost:3000/reset-password/${token}">Resetuj hasło</a>`,
	};

	transporter.sendMail(mailOptions, (error, info) => {
		if (error) {
			console.error('Błąd podczas wysyłania e-maila:', error);
		} else {
			console.log('E-mail został wysłany:', info.response);
		}
	});
};

/**
 * Resetowanie hasła użytkownika.
 *
 * @swagger
 * /api/user/reset-password:
 *   post:
 *     summary: Resetowanie hasła użytkownika
 *     description: Endpoint służący do resetowania hasła użytkownika na podstawie adresu e-mail.
 *     tags:
 *       - Users
 *     requestBody:
 *       required: true
 *       content:
 *         application/json:
 *           schema:
 *             type: object
 *             properties:
 *               email:
 *                 type: string
 *                 format: email
 *                 example: kacpero1407@gmail.com
 *                 description: Adres e-mail użytkownika, któremu ma zostać zresetowane hasło.
 *             required:
 *               - email
 *     responses:
 *       200:
 *         description: Sukces. Link do resetowania hasła został wysłany na adres e-mail użytkownika.
 *         content:
 *           application/json:
 *             schema:
 *               type: object
 *               properties:
 *                 success:
 *                   type: boolean
 *                   description: Wartość logiczna określająca sukces operacji.
 *                 message:
 *                   type: string
 *                   description: Komunikat informujący o wysłaniu linku resetującego hasło.
 *                 token:
 *                   type: string
 *                   description: Token resetujący hasło, zakodowany dla bezpieczeństwa w adresie URL.
 *       404:
 *         description: Nie znaleziono użytkownika o podanym adresie e-mail.
 *         content:
 *           application/json:
 *             schema:
 *               type: object
 *               properties:
 *                 success:
 *                   type: boolean
 *                   example: false
 *                   description: Wartość logiczna określająca sukces operacji.
 *                 message:
 *                   type: string
 *                   description: Komunikat informujący o braku użytkownika o podanym adresie e-mail.
 *       500:
 *         description: Wystąpił błąd serwera.
 *         content:
 *           application/json:
 *             schema:
 *               type: object
 *               properties:
 *                 success:
 *                   type: boolean
 *                   example: false
 *                   description: Wartość logiczna określająca sukces operacji.
 *                 message:
 *                   type: string
 *                   description: Komunikat informujący o błędzie serwera.
 */

router.post('/reset-password', async (req, res) => {
	const { email } = req.body;

	try {
		const user = await User.findOne({ email });

		if (!user) {
			return res.status(404).json({
				success: false,
				message: 'Użytkownik o podanym adresie email nie istnieje!',
			});
		}

		const token = jwt.sign({ email }, process.env.JWT_SECRET, {
			expiresIn: '2m',
		});

		sendResetPasswordEmail(email, token);

		res.json({
			success: true,
			message: 'Link do resetowania hasła został wysłany na Twój adres email.',
			token: encodeURIComponent(token),
		});
	} catch (error) {
		console.error(error);
		res.status(500).json({ success: false, message: 'Coś poszło nie tak...' });
	}
});

