/**
 * Anulowanie rezerwacji.
 *
 * @swagger
 * /api/user/cancel-booking:
 *   post:
 *     summary: Anulowanie rezerwacji
 *     description: Endpoint służący do anulowania istniejącej rezerwacji.
 *     tags:
 *       - Users
 *     security:
 *       - bearerAuth: []
 *     requestBody:
 *       required: true
 *       content:
 *         application/json:
 *           schema:
 *             type: object
 *             properties:
 *               bookingId:
 *                 type: string
 *                 example: 65ca9d6eb7ef8f4585ade46d
 *                 description: Identyfikator rezerwacji do anulowania.
 *               reason:
 *                 type: string
 *                 example: Muszę odwołać rezerwację, poniewaz w skutek nieszczęśliwego wypadku znalazłem się w szpitalu. Najmocniej przepraszam Pana i proszę o wyrozumiałość.
 *                 description: Powód anulowania rezerwacji.
 *               userId:
 *                 type: string
 *                 example: 65ca721d7fc31232aaad0b03
 *                 description: Identyfikator użytkownika wykonującego anulację.
 *     responses:
 *       200:
 *         description: Sukces. Rezerwacja została pomyślnie anulowana.
 *         content:
 *           application/json:
 *             schema:
 *               type: object
 *               properties:
 *                 message:
 *                   type: string
 *                   description: Komunikat informujący o sukcesie operacji.
 *                 success:
 *                   type: boolean
 *                   example: true
 *                   description: Wartość logiczna określająca czy rezerwacja została pomyślnie anulowana.
 *
 *       403:
 *         description: Brak uprawnień do anulowania rezerwacji.
 *         content:
 *           application/json:
 *             schema:
 *               type: object
 *               properties:
 *                 message:
 *                   type: string
 *                   description: Komunikat informujący o braku uprawnień.
 *                 success:
 *                   type: boolean
 *                   example: true
 *                   description: Wartość logiczna określająca czy rezerwacja została pomyślnie anulowana.
 *       404:
 *         description: Rezerwacja nie istnieje.
 *         content:
 *           application/json:
 *             schema:
 *               type: object
 *               properties:
 *                 message:
 *                   type: string
 *                   description: Komunikat informujący o braku istnienia rezerwacji.
 *                 success:
 *                   type: boolean
 *                   example: true
 *                   description: Wartość logiczna określająca czy rezerwacja została pomyślnie anulowana.
 *       500:
 *         description: Wystąpił błąd serwera podczas anulowania rezerwacji.
 *         content:
 *           application/json:
 *             schema:
 *               type: object
 *               properties:
 *                 message:
 *                   type: string
 *                   description: Komunikat informujący o błędzie serwera.
 *                 success:
 *                   type: boolean
 *                   example: true
 *                   description: Wartość logiczna określająca czy rezerwacja została pomyślnie anulowana.
 */

router.post('/cancel-booking', authMiddleware, async (req, res) => {
	try {
		const { bookingId, reason, userId } = req.body;

		const booking = await Booking.findOne({ _id: bookingId });
		const userAsDj = await Dj.findOne({ userId: userId });

		const currentDate = new Date();
		if (
			booking.userId !== userId &&
			booking.djId !== userAsDj?._id.toString()
		) {
			return res.status(403).json({
				message: 'Brak uprawnień do anulowania tej rezerwacji!',
				success: false,
			});
		}

		const existingBooking = await Booking.findById(booking._id);

		if (!existingBooking) {
			return res
				.status(404)
				.json({ message: 'Rezerwacja nie istnieje!', success: false });
		}

		existingBooking.status = 'Anulowana';
		await existingBooking.save();

		const dj = await Dj.findById(booking?.djId);

		if (userId !== dj?.userId) {
			const user = await User.findById(dj?.userId);
			user.unseenNotifications.push({
				type: 'booking-cancellation',
				message: `Rezerwacja anulowana przez użytkownika. Powód anulowania: ${reason}. Pilnie skontaktuj się z uzytkownikiem oraz administratorem w celu uzasadnienia powodu i wyjaśnienia sytuacji!`,
				data: {
					bookingId: existingBooking._id,
					reason: reason,
				},
				onClickPath: '/app/user/bookings',
				createdAt: currentDate,
			});
			await user.save();
		} else {
			const user = await User.findById(booking.userId);
			user.unseenNotifications.push({
				type: 'booking-cancellation',
				message: `Rezerwacja została anulowana przez DJ-a. Powód anulowania: ${reason}. Pilnie skontaktuj się z DJ-em oraz administratorem w celu uzasadnienia powodu i wyjaśnienia sytuacji!`,
				data: {
					bookingId: existingBooking._id,
					reason: reason,
				},
				onClickPath: '/app/user/bookings',
				createdAt: currentDate,
			});
			await user.save();
		}

		res.json({
			message: 'Rezerwacja została pomyślnie anulowana.',
			success: true,
		});
	} catch (error) {
		console.error(error);
		res.status(500).json({
			message: 'Wystąpił błąd podczas anulowania rezerwacji!',
			success: false,
		});
	}
});

